def gcd(a, b):  # greatest common divisor
    if b == 0:
        return a
    else:
        return gcd(b, a % b)

def lcm(a, b):  # least common multiple
    return a * b // gcd(a, b)

n = int(input())
a = list(map(int, input().split()))

ans = a[0]
